/**
  给你一个整数数组 nums 和一个整数 k。如果某个连续子数组中恰好有 k 个奇数数字，我们就认为这个子数组是「优美子数组」。

  请返回这个数组中 「优美子数组」 的数目。

  示例 1：
  输入：nums = [1,1,2,1,1], k = 3
  输出：2
  解释：包含 3 个奇数的子数组是 [1,1,2,1] 和 [1,2,1,1] 。

  示例 2：
  输入：nums = [2,4,6], k = 1
  输出：0
  解释：数列中不包含任何奇数，所以不存在优美子数组。

  示例 3：
  输入：nums = [2,2,2,1,2,2,1,2,2,2], k = 2
  输出：16

  提示：

  1 <= nums.length <= 50000
  1 <= nums[i] <= 10^5
  1 <= k <= nums.length

 */

/**
 * 超时 O(n^2)
 *
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
let numberOfSubarrays2 = function(nums, k) {
  let oddNum = 0; // 当前窗口的奇数个数
  let ans = 0; // 满足条件的窗口个数
  let left = 0,
      right = 0;

  while (left < nums.length) {
    if (!nums[right]) {
      left++;
      right = left;
      oddNum = 0;
      continue;
    }

    if (nums[right] % 2 !== 0) {
      oddNum += 1;
    }

    if (oddNum === k) {
      ans++;
    } else if (oddNum > k) { // 当奇数个数开始大于k
      left++;
      right = left;
      oddNum = 0;
      continue;
    }

    right++; // 扩大窗口
  }

  return ans;
};

/**
 * 参考1: https://leetcode-cn.com/problems/count-number-of-nice-subarrays/solution/xun-zhao-ji-di-you-mei-shu-zu-xiang-liang-ce-kuo-z/
 * 参考2: https://www.bilibili.com/video/BV1ia4y1x79i
 *
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
let numberOfSubarrays = function(nums, k) {
  // 此时满足最短优美子数组为 [oddIndex[i], oddIndex[i + k - 1]]，并且最短优美子数组的左右两边必定为奇数。例如: 当前对于第1个奇数的最短优美子数组为 (oddIndex[0], oddIndex[0 + 2 - 1]) 这里的例子 输入为[[0, 1, 1, 0, 1], 2];
  // 现在，我们需要找出 其他 包含了 (oddIndex[i], oddIndex[i + k - 1]) 的所有优美子数组

  // 对于 满足最短优美子数组的 左边第一个 奇数，它的 索引 为 oddIndex[i - 1]，那么，(oddIndex[i - 1], oddIndex[i]) 之间的数都为偶数
  // 对于 满足最短优美子数组的 右边第一个 奇数，它的 索引 为 oddIndex[i + k - 1]，那么，[oddIndex[i + k - 1], oddIndex[i + k]] 之间的数也为偶数

  // 则包含 当前奇数 的优美子数组个数: ((到上一个奇数为止)左边的偶数个数 + 1) x ((到下一个奇数为止)右边的偶数个数 + 1)
  // 将上式简化，得到表达式: (oddIndex[i] − oddIndex[i−1]) × (oddIndex[i + k] − oddIndex[i + k − 1])

  // 处理边界: 因为第一个奇数前面已经没有奇数了，所以直接代入公式会错误，如oddIndex:[1, 2, 4], oddIndex[1] − oddIndex[1 - 1] =>
  let total = 0
  let odd = [] // 存放奇数的索引
  let oddAmount = 0 // 奇数的个数

  for (let i = 0; i < nums.length; i++) {
    if (nums[i] % 2 === 1)
      odd.push(i)
  }

  oddAmount = odd.length
  odd.unshift(-1)
  odd.push(nums.length)

  for (let i = 1; i + k <= oddAmount + 1; i++) {
    total += (odd[i] - odd[i - 1]) * (odd[i + k] - odd[i + k - 1])
  }

  return total
};




